exports=async function(a,b,c,d){const{parseContent:e,trimBeforeContent:f}=await require("transcode/parse_content");return e(a,null,{clientOptions:{...(d&&d.clientOptions)},parser:a=>{const b=a.indexOf("id=\"txt\">");if(-1===b)return null;const c=a.substring(b);return c.subRegexMapAll(/<dd data-id="(?<order>\d+)">(?<content>.+?)<\/dd>/g).map(a=>({order:parseInt(a.order),content:a.content})).sort((c,a)=>c.order-a.order).filter(a=>999!==a.order).map(a=>a.content.split(/<\/?p>/).map(a=>a.trim())).flat().filter(a=>0<a.length)}})};